import {
  Box,
  Button,
  chakra,
  Icon,
  shouldForwardProp,
  Text,
} from '@chakra-ui/react'
import { css, SerializedStyles } from '@emotion/react'
import {
  isValidMotionProp,
  motion,
  MotionValue,
  useScroll,
  useSpring,
  useTransform,
} from 'framer-motion'
import { ReactNode, useEffect, useRef, useState } from 'react'

/* -------------------------------------------------------------------------- */
/*                                  displays                                  */
/* -------------------------------------------------------------------------- */
const MotionBox = chakra(motion.div, {
  /**
   * Allow motion props and non-Chakra props to be forwarded.
   */
  shouldForwardProp: (prop) =>
    isValidMotionProp(prop) || shouldForwardProp(prop),
})

const NumberDisplay = (props: { children: ReactNode }) => {
  return (
    <Box width="100%" height="100vh" position="relative">
      {props.children}
    </Box>
  )
}

const TextDisplay = (props: { children: ReactNode }) => {
  return (
    <Box
      display="flex"
      alignItems="center"
      width="100%"
      height="100vh"
      mx="auto"
      maxW="80rem"
    >
      <Text
        as="h1"
        px="1rem"
        mb="2rem"
        fontSize="3rem"
        textAlign="left"
        lineHeight="1.25"
      >
        {props.children}
      </Text>
    </Box>
  )
}

const CardDisplay = (props: {
  scrollY: MotionValue<number>
  transformValue: number[]
  translateValue: number[]
  rotateValue: number[]
  children: ReactNode
}) => {
  // cards
  const transformedTranslateYCard = useTransform(
    props.scrollY,
    props.transformValue,
    props.translateValue
  )

  const transformedRotateYCard = useTransform(
    props.scrollY,
    props.transformValue,
    props.rotateValue
  )

  const translateCard = useSpring(transformedTranslateYCard, {
    stiffness: 600,
    damping: 120,
    restSpeed: 0.5,
  })

  const rotateCard = useSpring(transformedRotateYCard, {
    stiffness: 600,
    damping: 120,
    restSpeed: 0.5,
  })

  return (
    <MotionBox
      position="absolute"
      top={{ base: '6vh', lg: '50%' }}
      right={{ base: '1rem', xl: 0 }}
      transform="rotate(-40deg) translateY(-100vh)"
      style={{ y: translateCard, rotate: rotateCard }}
    >
      {props.children}
    </MotionBox>
  )
}

const PageThreeCardDisplay = (props: {
  scrollY: MotionValue<number>
  transformValue: number[]
  translateValue: number[]
  children: ReactNode
  styles?: SerializedStyles
}) => {
  // cards
  const transformedTranslateYCard = useTransform(
    props.scrollY,
    props.transformValue,
    props.translateValue
  )

  const translateCard = useSpring(transformedTranslateYCard, {
    stiffness: 600,
    damping: 120,
    restSpeed: 0.5,
  })

  return (
    <motion.div
      css={[
        css({
          position: 'absolute',
          top: '50%',
        }),
        props.styles,
      ]}
      style={{ y: translateCard }}
    >
      {/* <MotionBox
      position="absolute"
      top="50%"
      style={{ y: translateCard, ...props.css }}
    > */}
      {props.children}
      {/* </MotionBox> */}
    </motion.div>
  )
}

